      <div className="container">
        <div className="item users">
          <div>
            <h2>Users()</h2>
            <p>user list</p>
            <button>Leave Chat</button>
          </div>
        </div>
        <div className="item chat">Chat</div>
        <div className="item chart">Chart</div>
      </div>
    </div>
  );
}

export { Chat };
